import Link from "next/link";

function Navbar() {
  return (
    <>
      <nav className="Nav">
        <div className="Logo">
          <Link href="/">
            <a>Westfield Web</a>
          </Link>
        </div>
        <div className="Nav-items">
          <Link href="/plansandpricing">
            <a>Plans and Pricing</a>
          </Link>
          <Link href="/portfolio">
            <a>Portfolio</a>
          </Link>
        </div>
      </nav>
      <style jsx>{`
        .Nav {
          display: flex;
          justify-content: space-around;
          background-color: #eee;
          padding: 20px;
        }
        .Logo a {
          color: #000;
          // text-decoration: none;
        }

        .Nav-items a {
          margin-right: 60px;
          text-decoration: none;
          color: #000;
        }

        .Nav-items a:hover {
          cursor: pointer;
          background-color: pink;
        }
      `}</style>
    </>
  );
}

export default Navbar;
